#include <vector>
#include <queue>
using namespace std;

class Solution {
    bool isBorder(pair<int, int> p, int m, int n) {
        return p.first == 0 || p.first == m-1 || p.second == 0 || p.second == n-1;
    }

    bool valid(vector<vector<char>>& maze, int r, int c) {
        if (r >= 0 && r < maze.size() && c >= 0 && c < maze[0].size() && maze[r][c] != '+') {
            maze[r][c] = '+';
            return true;
        }

        return false;
    }
public:
    int nearestExit(vector<vector<char>>& maze, vector<int>& entrance) {
        pair<int, int> entrancePair = {entrance[0], entrance[1]};

        queue<pair<int,int>> q;
        q.push(entrancePair);
        maze[entrance[0]][entrance[1]] = '+';
        
        int m = maze.size(), n = maze[0].size();
        int ans = 0;

        while (!q.empty()) {
            int curLevelSize = q.size();
            for (int i=0; i<curLevelSize; i++) {
                pair<int, int> cur = q.front();
                q.pop();
                
                if (cur != entrancePair && isBorder(cur, m, n)) return ans;

                if (valid(maze, cur.first + 1, cur.second)) q.push({cur.first + 1, cur.second});
                if (valid(maze, cur.first, cur.second + 1)) q.push({cur.first, cur.second + 1});
                if (valid(maze, cur.first - 1, cur.second)) q.push({cur.first - 1, cur.second});
                if (valid(maze, cur.first, cur.second - 1)) q.push({cur.first, cur.second - 1});
            }
            ans++;
        }

        return -1;
    }
};

